        public static object AccountDetails(string url, AccountDetailsRequestModel request)
        {
            try
            {
                string response = APIService.POST(url, request, request.access_token);
                if (!string.IsNullOrEmpty(response))
                {
                    var result = JsonConvert.DeserializeObject<AccountDetailsModel>(response);

                    if (result != null)
                    {
                        Utils.ImalLog("POSTING WAS SUCCESSFUL WITH DETAILS: " + response);
                        return result;
                    }
                    else
                    {
                        Utils.ImalLog("POST FAILURE WITH DETAILS: " + result);
                        return null;
                    }
                }
                else
                {
                    Utils.ImalLog("Empty Response from Client's API");
                    return null;
                }
            }
            catch (Exception ex)
            {
                Utils.ImalLog("GetAccountFullInfo error message: " + ex.Message);
                throw ex;
            }
        }

        public static IMALLocalFTResponse LocalFT(string url, LocalFT request, string access_token)
        {
            try 
            {
                IMALLocalFTResponse result = null;
                string response = APIService.POST(url, request, access_token);
                if (!string.IsNullOrEmpty(response))
                {
                    object obj= JsonConvert.DeserializeObject<object>(response);
                     result = JsonConvert.DeserializeObject<IMALLocalFTResponse>(obj.ToString());

                    if (result != null)
                    {
                        Utils.ImalLog("POSTING WAS SUCCESSFUL WITH DETAILS: " + response);
                        return result;
                    }
                    else
                    {
                        Utils.ImalLog("POST FAILURE WITH DETAILS: " + result);
                        return null;
                    }
                }
                else
                {
                    Utils.ImalLog("Empty Response from Client's API");
                    return null;
                }
            }
            catch (WebException ex)
            {
                Utils.ImalLog("GetAccountFullInfo error message: " + ex.Message);
                if (ex.Response != null)
                {
                    using (var errorResponse = (HttpWebResponse)ex.Response)
                    {
                        Utils.ImalLog("errorResponse: " + errorResponse);
                        using (var reader = new StreamReader(errorResponse.GetResponseStream()))
                        {
                            string error = reader.ReadToEnd();
                            Utils.ImalLog("errorResponse2: " + error);
                             object obj = JsonConvert.DeserializeObject<object>(error);
                            //  Utils.ImalLog("errorResponse3: " + obj);
                             var serializedResponse = JsonConvert.SerializeObject(obj); 
                            return JsonConvert.DeserializeObject<IMALLocalFTResponse>(serializedResponse,
                               new JsonSerializerSettings
                               {
                                   NullValueHandling = NullValueHandling.Ignore
                               });
                            //JsonConvert.DeserializeObject<IMALLocalFTResponse>(error);
                        }
                    }
                }
                else
                {
                    return null;
                }
            }
        }

