        public static object GetAccountDetailsByNuban(string url,
                                        string access_token, string accountNum)
        {
            try
            {
                Utils.ImalLog("IMAL NAME ENQ URL: " + url + ", imal Request: " + accountNum);
                string response = APIService.GET(url, access_token);//POST(url, request, access_token);
                Utils.ImalLog("IMAL Response: " + response);
                if (!string.IsNullOrEmpty(response))
                {
                    var result = JsonConvert.DeserializeObject<IMALAccountModel>(response);
                    Utils.ImalLog("obj: " + result);
                    if (result != null)
                    {
                        Utils.ImalLog("POSTING WAS SUCCESSFUL WITH DETAILS: " + response);
                        customerMaster customerDetail = new customerMaster();
                        customerDetail.AccountNo = accountNum;
                        customerDetail.customerId = result.GetAccounts.ACCOUNT_NO;
                        customerDetail.AccountName = result.GetAccounts.ACC_NAME;
                        customerDetail.AccountType = result.GetAccounts.ACC_TYPE;
                        customerDetail.BranchCode = result.GetAccounts.BRANCH_NAME;
                        customerDetail.CurrencyCode = result.GetAccounts.CURRENCY_CODE.ToString();
                        customerDetail.AccountStatus = result.GetAccounts.STATUS;
                        customerDetail.Currency = result.GetAccounts.CURRENCY;
                        customerDetail.Email = result.GetAccounts.EMAIL;
                        customerDetail.PhoneNo = result.GetAccounts.PHONE_NUMBER;
                        customerDetail.Abbrev = result.GetAccounts.CURRENCY;
                        customerDetail.Bookbalance = result.GetAccounts.Aval_Balance;
                        customerDetail.Availablebalance = result.GetAccounts.Aval_Balance; //please remove comma seprated

                        return customerDetail;
                    }
                    else
                    {

                        Utils.ImalLog("POST FAILURE WITH DETAILS: " + result);
                        return null;

                    }
                }
                else
                {
                    Utils.ImalLog("Empty Response from Client's API");
                    return null;
                }
            }
            catch (Exception ex)
            {
                Utils.ImalLog("GetAccountFullInfo error message: " + ex.Message);
                throw ex;
            }

        }

